','','','','','','0','','','','','',''),(339,35,1,'Cork town','Ontario - Toronto - Downtown - Cork town','','','','','','','0','','','','','',''),(340,35,2,'Cork town','Ontario HR - Toronto - Downtown - Cork town','','','','','','','0','','','','','',''),(341,34,1,'City place','Ontario - Toronto - Downtown - City place','','','','','','','0','','','','','',''),(342,34,2,'City place','Ontario HR - Toronto - Downtown - City place','','','','','','','0','','','','','',''),(345,18,1,'Toronto','Ontario - Toronto','','','','','','','0','','','','','',''),(346,18,2,'Toronto','Ontario HR - Toronto','','','','','','','0','','','','','',''),(347,21,1,'Scarborough','Ontario - Scarborough','','','','','','','0','','','','','',''),(348,21,2,'Scarborough','Ontario HR - Scarborough','','','','','','','0','','','','','',''),(349,20,1,'North York','Ontario - North York','','','','','','','0','','','','','',''),(350,20,2,'North York','Ontario HR - North York','','','','','','','0','','','','','',''),(351,19,1,'Etobicoke','Ontario - Etobicoke','','','','','','','0','','','','','',''),(352,19,2,'Etobicoke','Ontario HR - Etobicoke','','','','','','','0','','','','','',''),(361,13,1,'Ontario','Ontario','','','','','','','0','','','','','',''),(362,13,2,'Ontario HR','Ontario HR','','','','','','','0','','','','','',''),(363,25,1,'Westdale','McMaster University - Hamilton - Westdale','','','','','','','0','','','','','',''),(364,25,2,'Westdale','McMaster University - Hamilton - Westdale','','','','','','','0','','','','','',''),(365,27,1,'South of Campus','McMaster University - Hamilton - South of Campus','','','','','','','0','','','','','',''),(366,27,2,'South of Campus','McMaster University - Hamilton - South of Campus','','','','','','','0','','','','','',''),(367,23,1,'Hamilton','McMaster University - Hamilton','','','','','','','0','','','','','',''),(368,23,2,'Hamilton','McMaster University - Hamilton','','','','','','','0','','','','','',''),(369,15,1,'McMaster University','McMaster University','','','','','','','0','','','','','',''),(370,15,2,'McMaster University','McMaster University','','','','','','','0','','','','','',''),(371,22,1,'Winnipeg','Manitoba - Winnipeg','Winnipeg','','Winnipeg','<h3><a name=\"History\" id=\"History\">History </a></h3>\r\n                <p>The history of Alexandra Park is one  that was initiated by a Polish Engineer. For some time, the biggest symbol of  the neighborhood was the grand home called â€œThe Hallâ€. After the development of  The Hall came developments for Polish and Ukrainian immigrants around the  1920â€™s and 1930â€™s. In the 1960â€™s the hall was demolished to make way for public  housing. The Area started to slowly be inhabited by Chinese, Vietnamese, East  Africans and Caribbeans. </p>\r\n                <p>The neighborhood started to grow violent around the  1970â€™s with the uprising of the infamous African Canadian gang called the  Project Originals. Drugs quickly became a problem and it wasnâ€™t too long before  members of the community turned to the government for redevelopment. With the  help of the Toronto Community Housing Corporation, the neighbourhood is on the  road to a bright future and endless opportunity. </p>\r\n<h3><a name=\"Lifestyle\">Lifestyle</a></h3>\r\n<p>Generally located in between Dundas St  W and Queen St W from north to south, and Spadina Ave to Bathurst St from east  to west, Alexandra &nbsp;Park is famous for its convenience and variety. A  mixture of residential, commercial, and institutional buildings line the  neighbourhoodsâ€™ many streets. However, there is also the 2.7 hectare Alexandra  Park, the neighbourhoodsâ€™ namesake, which includes a community garden, a  baseball diamond, an outdoor pool, and even an artificial ice skating rink. The  park is a picturesque and convenient escape for those looking to escape the  hustle and bustle of daily city life. </p>\r\n<p>As detailed below under Housing, the  neighbourhood of Alexandra Park is undergoing a mass residential overhaul, with  an aim to improve the quality of life for those most in need. While much of the  focus has been on the housing fixes, additions, and other residential  development, there is much more to look forward to for this Toronto  neighbourhood. </p>\r\n<p>There is to be retail space added the  ground level of building developments, in order to provide residents with  shopping alternatives to add to the nearby Kensington Market and Chinatown.  Shopping in those districts is another advantage of life in Alexandra Park.  Residents can also feel excitement for two brand new parks and new streets. The  once secluded community can potentially become an integral part of Toronto. </p>\r\n<h3><a name=\"Housing\">Housing </a>				</h3>\r\n				<p>Houses in the Alexandra park  neighborhood tend to be more Victorian Style. They date back as far as the  1880â€™s. Bungalos are common in the neighborhood. A few semi-detached houses  exist as well but the most popular type of houses are townhouses due to the  developments of the Park Housing Cooperative. Prices of the privately owned  houses can range anywhere from $200,000-$600,000. </p>\r\n				<p>Future plans for the  neighborhood involving the Toronto Community Housing Corporation see extensive  redevelopment, including razing and replacement of over 300 subsidized  townhouses and apartments, refurbishment of nearly 500 subsidized apartments,  and the addition of more 1,500 units at market value. Such exciting prospects  can potentially lead to Alexandra Park, amongst the cityâ€™s worst neighbourhoods  in the 1990s, becoming one of its most desirable. </p>','winnipeg','winnipeg','0','ad1','ad2','ad3','','',''),(372,22,2,'Winnipeg','Manitoba - Winnipeg','Winnipeg','','Winnipeg','<h3><a name=\"History\" id=\"History\">History </a></h3>\r\n                <p>The history of Alexandra Park is one  that was \r\ninitiated by a Polish Engineer. For some time, the biggest symbol of  \r\nthe neighborhood was the grand home 